import { ALL_COMM_URL } from "../constants";
import axios from "axios";
import React, { useState } from "react";
import Header from "./Header";

const JoinCommunity = () => {

    const [comm, setComm] = useState([]);

    const fetchCommunity = () => {
        axios.get(ALL_COMM_URL)
        .then(res => {
            console.log(res.data);
            setComm(res.data);
        })
    }

    React.useEffect(() => {
        fetchCommunity();
    });

    return (
        <div>
            <Header />
            <div class="container d-flex justify-content-center">
                <ul class="list-group mt-5 text-white">
                    {comm.map((ch) =>
                    <li class="list-group-item d-flex justify-content-between align-content-center">
                        <div class="d-flex flex-row"> <img src="https://img.icons8.com/color/100/000000/folder-invoices.png" width="40" />
                            <div class="ml-2">
                                <h6 class="mb-0">{ch.name}</h6>
                                <div class="about"><span>{ch.info}</span></div>
                            </div>
                        </div>
                        <div class="check"> <input type="checkbox" name="a" /> </div>
                    </li>
                    )}
                </ul>
            </div>
        </div>
    );
}

export default JoinCommunity;
